actionConfiguration.body:
(rank_tier, leaderboard_rank) => {
		let rank_tiker_icon = ''
		if (rank_tier) {
			if (leaderboard_rank >= 1 && leaderboard_rank <=10 ) {
				rank_tiker_icon = rank_tier.toString()[0] + 'c'
			} else if (leaderboard_rank <=100 && leaderboard_rank > 10) {
				rank_tiker_icon = rank_tier.toString()[0] + 'b'
			} else {
				rank_tiker_icon = rank_tier.toString()[0]
			}
		} else {
			rank_tiker_icon = 0
		}
		return `https://www.opendota.com/assets/images/dota2/rank_icons/rank_icon_${rank_tiker_icon}.png`
	}

